import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header className="bg-blue-700 text-white p-4 flex justify-between">
      <h1 className="text-2xl font-bold">Dream Fest 2K25</h1>
      <nav>
        <Link to="/" className="mr-4">Home</Link>
        <Link to="/register" className="mr-4">Book Ticket</Link>
        <Link to="/admin/login" className="font-bold text-yellow-300">Admin</Link>
      </nav>
    </header>
  );
};

export default Header;
